def pluse_style(name,start_col):
	wb = load_workbook(filename)
	ws = wb.get_sheet_by_name(name)
	al=Alignment(horizontal='center',vertical='center')
	timer=0
	for col in ws.iter_cols():
		timer+=1
		if(timer>=start_col):
			for cell in col:
				ws.column_dimensions[cell.column].width=12
				break
			for cell2 in col:
				indexn=str(cell2.column)+str(cell2.row)
				ws[indexn].alignment=al
	wb.save(filename)

def initial_style(name):
	wb = load_workbook(filename)
	ws = wb.get_sheet_by_name(name)
	al=Alignment(horizontal='center',vertical='center')
	for col in ws.iter_cols():
		for cell in col:
			ws.column_dimensions[cell.column].width=12
			break
		for cell2 in col:
			indexn=str(cell2.column)+str(cell2.row)
			ws[indexn].alignment=al
	ws['A1'].font=Font(size=12,bold=True)
	ws.column_dimensions['A'].width=10
	ws.column_dimensions['B'].width=8
	ws.column_dimensions['C'].width=18
	ws.row_dimensions[29].hidden = True
	wb.save(filename)

