def UI_submit(Name,word):
	button['state']=DISABLED
	button.config(text='execute')
	button2['state']=DISABLED
	button3['state']=DISABLED
	button4['state']=DISABLED

	Name=Name.split(' ')
	if len(Name)>1:
		word.insert('1.0','一共輸入'+str(len(Name))+'筆資料')
		word.update()
	for name in Name:
		change_schedule(0,1)
		word.configure(state='normal')
		word.insert('1.0','執行股票'+name+'\n')
		word.update()
		#檢查該表單是否已存在
		try:
			modify_sheet(name,word)
			word.insert('1.0','股票已存在表單，已更新至最新日期\n')
			word.update()

		#嘗試新增表單
		except:
			if right_stocknumber(name,word):
				word.insert('1.0','開始建立新表單，並蒐集資料\n')
				word.update()
				initial_write(name)
				parse_all_qry(name,word)
				initial_style(name)
			else:
				print('4\n')
				word.insert('1.0','輸入代碼有誤,請重新嘗試\n')
				word.update()
		update_all_plot()
	word.insert('1.0','已完成本次更新\n')
	word.update()
	word.configure(state='disabled')
	button['state']=NORMAL
	button.config(text='submit')
	button2['state']=NORMAL
	button3['state']=NORMAL
	button4['state']=NORMAL

