#更新进度条函数
def change_schedule(now_schedule,all_schedule):
	canvas = Canvas(frame,width = 400,height = 25,bg = "white")
	canvas.grid(row = 50,column = 40)
	x = StringVar()
	#进度条以及完成程度
	out_rec = canvas.create_rectangle(5,5,400,25,outline = "black",width = 1)
	fill_rec = canvas.create_rectangle(5,5,400,25,outline = "",width = 0,fill = "black")
	canvas.coords(fill_rec, (5, 5, 6 + (now_schedule/all_schedule)*395, 25))
	win.update()
	x.set(str(round(now_schedule/all_schedule*100,2)) + '%')

